<script>


var years,
    monthFormat = d3.time.format("%Y");

var margin = {top: 30, right: 60, bottom: 30, left: 60},
    width = 960 - margin.left - margin.right,
    height = 600 - margin.top - (margin.bottom / 2),
    keypos = height + (margin.bottom * 2);

var x = d3.time.scale()
    .range([0, width]);

var y = d3.scale.linear()
    .range([height, 0]);


var xAxis = d3.svg.axis()
    .scale(x)
	.tickFormat(d3.time.format('%Y'))
    .orient("bottom");


var yAxis = d3.svg.axis()
	.scale(y)
	.orient("left")
	.ticks(10);    
    
var color = d3.scale.category20();

var voronoi = d3.geom.voronoi()
    .x(function(d) { return x(d.date); })
    .y(function(d) { return y(d.value); })
    .clipExtent([[-margin.left, -margin.top], [width + margin.right, height + margin.bottom]]);

var line = d3.svg.line()
    .x(function(d) { return x(d.date); })
    .y(function(d) { return y(d.value); });

var svg = d3.select("body").append("svg")
    .attr("width", width + margin.left + margin.right)
    .attr("height", height + margin.top + (margin.bottom * 2))
  .append("g")
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

d3.tsv("topics_line_vis.tsv", type, function(error, topics) {
	x.domain(d3.extent(years));
	y.domain([0, d3.max(topics, function(c) { return d3.max(c.values, function(d) { return d.value; });
 })]).nice();




  svg.append("g")
      .attr("class", "axis")
      .attr("transform", "translate(0," + height + ")")
      .call(xAxis);

  svg.append("g")
      .attr("class", "axis axis--y")
      .call(yAxis)
    .append("text")
      .attr("class", "yaxistext")
      .attr("x", -height/2 + margin.top)
      .attr("y", -45)
      .attr("transform", "rotate(-90)")
      .text("Topic Prevalence");

  svg.append("g")
      .attr("class", "topics")
    .selectAll("path")
      .data(topics)
    .enter().append("path")
      .attr("d", function(d) { d.line = this; return line(d.values); });

  var focus = svg.append("g")
      .attr("transform", "translate(-100,-100)")
      .attr("class", "focus");


  focus.append("text")
      .attr("y", -10)
      .attr("x", width/2)
      .attr("text-anchor", "middle");


  var voronoiGroup = svg.append("g")
      .attr("class", "voronoi");

  voronoiGroup.selectAll("path")
      .data(voronoi(d3.nest()
          .key(function(d) { return x(d.date) + "," + y(d.value); })
          .rollup(function(v) { return v[0]; })
          .entries(d3.merge(topics.map(function(d) { return d.values; })))
          .map(function(d) { return d.values; })))
    .enter().append("path")
      .attr("d", function(d) { return "M" + d.join("L") + "Z"; })
      .datum(function(d) { return d.point; })
      .on("mouseover", mouseover)
      .on("mouseout", mouseout);


  function mouseover(d) {
    d3.select(d.topic.line).classed("topic--hover", true);
    d.topic.line.parentNode.appendChild(d.topic.line);
    focus.attr("transform", "translate(0," + keypos + ")");
    focus.select("text").text(d.topic.words);
          
  }

  function mouseout(d) {
    d3.select(d.topic.line).classed("topic--hover", false);
    focus.attr("transform", "translate(-100,-100)");
  }

function type(d, i) {
	
	if (!i) years = Object.keys(d).map(monthFormat.parse).filter(Number);
	
	var topic = {
		words: d.words,
		values: null
	};

	topic.values = years.map(function(m) {
		return {
			topic: topic,
			date: m,
			value: d[monthFormat(m)] * 1
		};
	});
	
	return topic;
}
